import Navbar from './components/Navbar';
import Hero from './components/Hero';
import SEO from './components/SEO';
import Footer from './components/Footer';
import MainSection from './components/MainSection';


function App() {
	return (
		<>
			<Navbar />
			<Hero />
			<MainSection />
			<SEO />
			<Footer />
		</>
	);
}

export default App;
